package co.fin.core.kjh.company.vo;

public class CompanyVo {
	private int company_no;
	private String company_name;
	private String company_phone;
	private String company_addr;
	private String company_email;
	private String ceo_name;
	private String ceo_phone;
	private String business_license_number;

	public CompanyVo() {
		// TODO Auto-generated constructor stub
	}

	public int getCompany_no() {
		return company_no;
	}

	public void setCompany_no(int company_no) {
		this.company_no = company_no;
	}

	public String getCompany_name() {
		return company_name;
	}

	public void setCompany_name(String company_name) {
		this.company_name = company_name;
	}

	public String getCompany_phone() {
		return company_phone;
	}

	public void setCompany_phone(String company_phone) {
		this.company_phone = company_phone;
	}

	public String getCompany_addr() {
		return company_addr;
	}

	public void setCompany_addr(String company_addr) {
		this.company_addr = company_addr;
	}

	public String getCompany_email() {
		return company_email;
	}

	public void setCompany_email(String company_email) {
		this.company_email = company_email;
	}

	public String getCeo_name() {
		return ceo_name;
	}

	public void setCeo_name(String ceo_name) {
		this.ceo_name = ceo_name;
	}

	public String getCeo_phone() {
		return ceo_phone;
	}

	public void setCeo_phone(String ceo_phone) {
		this.ceo_phone = ceo_phone;
	}

	public String getBusiness_license_number() {
		return business_license_number;
	}

	public void setBusiness_license_number(String business_license_number) {
		this.business_license_number = business_license_number;
	}
	
	
}
